static void openpmxtran_data_preprocess(void)
{
	RECORD* data = openpmx.data.writeable;
	const int nrecords = openpmx.data.nrecords;
	int i = 0;
	int n = 0;
	for (i=0; i<nrecords; i++) {
		RECORD r = data[i];
		if (openpmxtran_data_preprocess_callback(&r)) {
			data[n] = r;
			++n;
		}
	}
	for (i=n; i<nrecords; i++)
		data[n].ID = NAN;
}

